                type="password"
                icon={<Icon>lock_outline</Icon>}
                label="Repeat Password"
                ref={(input) => this.textInput = input}
                s={12}
              />
            </Row>
            <Row>
              <Col s={12} className="input-field">
                <Button
                  waves="light"
                  className="col s12"
                  onClick={onRegisterClick}
                >
                  Register
                </Button>
              </Col>
            </Row>
          </div>
        </Col>
      </Row>
    </Section>
  );
}
